/// stdio state variables.
///
/// The following always hold:
///
/// if (_flags&(__SLBF|__SWR)) == (__SLBF|__SWR),
/// _lbfsize is -_bf._size, else _lbfsize is 0
/// if _flags&__SRD, _w is 0
/// if _flags&__SWR, _r is 0
///
/// This ensures that the getc and putc macros (or inline functions) never
/// try to write or read from a file that is in `read' or `write' mode.
/// (Moreover, they can, and do, automatically switch from read mode to
/// write mode, and back, on "r+" and "w+" files.)
///
/// _lbfsize is used only to make the inline line-buffered output stream
/// code as compact as possible.
///
/// _ub, _up, and _ur are used when ungetc() pushes back more characters
/// than fit in the current _bf, or when ungetc() pushes back a character
/// that does not match the previous one in _bf.  When this happens,
/// _ub._base becomes non-nil (i.e., a stream has ungetc() data iff
/// _ub._base!=NULL) and _up and _ur save the current values of _p and _r.
///
/// NB: see WARNING above before changing the layout of this structure!
typedef FILE = __sFILE;
typedef GAllocator = _GAllocator;
typedef GArray = _GArray;
typedef GArray_autoptr = ffi.Pointer<GArray>;
typedef GArray_listautoptr = ffi.Pointer<GList>;
typedef GArray_queueautoptr = ffi.Pointer<GQueue>;
typedef GArray_slistautoptr = ffi.Pointer<GSList>;
typedef GAsyncQueue = _GAsyncQueue;
typedef GAsyncQueue_autoptr = ffi.Pointer<GAsyncQueue>;
typedef GAsyncQueue_listautoptr = ffi.Pointer<GList>;
typedef GAsyncQueue_queueautoptr = ffi.Pointer<GQueue>;
typedef GAsyncQueue_slistautoptr = ffi.Pointer<GSList>;

/// GAsyncReadyCallback:
/// @source_object: (nullable): the object the asynchronous operation was started with.
/// @res: a #GAsyncResult.
/// @data: user data passed to the callback.
///
/// Type definition for a function that will be called back when an asynchronous
/// operation within GIO has been completed. #GAsyncReadyCallback
/// callbacks from #GTask are guaranteed to be invoked in a later
/// iteration of the
/// [thread-default main context][g-main-context-push-thread-default]
/// where the #GTask was created. All other users of
/// #GAsyncReadyCallback must likewise call it asynchronously in a
