        8 => G_IO_FLAG_IS_WRITABLE,
        16 => G_IO_FLAG_IS_SEEKABLE,
        31 => G_IO_FLAG_MASK,
        3 => G_IO_FLAG_SET_MASK,
        _ => throw ArgumentError('Unknown value for GIOFlags: $value'),
