  @override
  String toString() {
    if (this == G_IO_FLAG_IS_WRITABLE)
      return "GIOFlags.G_IO_FLAG_IS_WRITABLE, GIOFlags.G_IO_FLAG_IS_WRITEABLE";
    if (this == G_IO_FLAG_MASK)
      return "GIOFlags.G_IO_FLAG_MASK, GIOFlags.G_IO_FLAG_GET_MASK";
    return super.toString();
  }
}

