  @ffi.Int()
  external int ref_count;

  /// VipsImage we are attached to
  external ffi.Pointer<_VipsImage> im;

  /// Area of image we have mapped, in pixels
  @ffi.Int()
  external int top;

  @ffi.Int()
  external int height;

  /// First pixel of line 'top'
  external ffi.Pointer<VipsPel> data;

  /// Base of window
  external ffi.Pointer<ffi.Void> baseaddr;

  /// Size of window
  @ffi.Size()
  external int length;
}

