/// Region types.
enum _RegionType {
  VIPS_REGION_NONE(0),

  /// A VipsBuffer
  VIPS_REGION_BUFFER(1),

  /// Memory on another region
  VIPS_REGION_OTHER_REGION(2),

  /// Memory on another image
  VIPS_REGION_OTHER_IMAGE(3),

  /// A VipsWindow on fd
  VIPS_REGION_WINDOW(4);

  final int value;
  const _RegionType(this.value);

  static _RegionType fromValue(int value) => switch (value) {
        0 => VIPS_REGION_NONE,
        1 => VIPS_REGION_BUFFER,
        2 => VIPS_REGION_OTHER_REGION,
        3 => VIPS_REGION_OTHER_IMAGE,
        4 => VIPS_REGION_WINDOW,
        _ => throw ArgumentError('Unknown value for _RegionType: $value'),
      };
}

